Writers:  Mindy Newell and Paul Levitz
Pencilers:  Dan Jurgens and Ernie Colon
Inkers:  Karl Kesel and Gary Martin
Colorist:  Carl Gafford
Letterer:  Bob Lappan
Cover:  Dan Jurgens, Jerry Ordway, and Anthony Tollin

Officer Cusimano calls in the Legion of Super-Heroes to stop a super-powered person from destroying everyone on the planet of Almados. She believes the person who attacked is Dev-Em, but Ultra Boy and Mon-El do not want to believe it is their friend who is involved. They chase down the perpetrator to find that it is Dev-Em, but soon learn that the Dark Circle has the real Dev-Em and have been cloning him.

